import React from "react";
import ReactDOM from "react-dom/client"; // Utilisez 'react-dom/client' pour React 18+
import App from "./App";

// Vérifiez que l'élément root existe dans le DOM
const rootElement = document.getElementById("root");

if (rootElement) {
  const root = ReactDOM.createRoot(rootElement); // Nouvelle méthode dans React 18
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
} else {
  console.error("L'élément avec l'id 'root' est introuvable dans le DOM.");
}
